import React from 'react'
import { NavLink } from 'react-router-dom'

const ManageNav = () => {

    const activeClassName = ({ isActive }) => {
        return isActive ? "active" : ""
    }
    const dataNameList = ['services', 'partners', 'industries', 'leaders', 'reasons', 'benefits', 'projects', 'recents', 'proprietary', 'slideShow'];
    return (
        <div className="container-fluid">
            <ul className="nav nav-pills justify-content-center">
                {dataNameList.map((item, index) => {
                    return (
                        <NavLink className={`nav-link ${activeClassName}`} to={`/manage/${item}`} key={index}>
                            {item}
                        </NavLink>)
                })}
            </ul>
        </div>
    )
}

export default ManageNav;
